import React from 'react';

function Property() {
  // JavaScript to handle checkbox change event
  const handleCheckboxChange = () => {
    var checkbox = document.getElementById('myCheckbox');
    console.log('Checkbox is ' + (checkbox.checked ? 'checked' : 'unchecked'));
  };

  return (
    <div className=''>
      <h4>Current Market Value : <input type='text'></input></h4>
      <h4>Land Square feet  : <input type='text'></input></h4>
      <h4>ZIP/PIN code : <input type='text'></input></h4>
      <h4>Building age  : <input type='text'></input></h4>
      <h4>Past records : <input type='text'></input></h4>

      <div>
        <label>
          <input type="checkbox" id="myCheckbox" onChange={handleCheckboxChange} />
          Check me!
        </label>
      </div>
    </div>
  );
}

export default Property;
